import React from 'react';
import { Link } from "react-router-dom";

function Header() {
  return (
    <header className="contentHeader align-c">
    <div className="headerLeft c-p align-c">
      <img width="28" src="./img/react.svg"></img>
    </div>
    <div className="headerRight align-c">
      <img width="20" src="./img/heart.svg" alt="hearth" className="heartSvg c-p" />
      <div className="cartBlock">
      <img width="20" src="./img/cart.svg" alt="cart" className="cartSvg c-p" />
      <span className="activatedCart"></span>
      </div>
      <img width="20" src="./img/history.svg" alt="history" className="historySvg c-p" />
    </div>
  </header>
  );
}

export default Header;
